        for char in input:
            if char in grammar.S:
                stack.append(char)
            elif char in grammar.NT6:
                if not stack:
                    return False
                top = stack.pop()
                if grammar.S.find(top) != -1:
                    return False
            elif char in grammar.NT5:
                if not stack:
